import styled from "styled-components";

export const HeaderTag = styled.header`
  background-color: var(--brand-color);
  color: white;
  @media (min-width: 767px) {
    display: flex;
    align-items: center;
  }
`;
export const Logo = styled.figure`
  width: 15%;
`;
